column5:
thanks all @shaun c believe it or not that's the pricing different just on the rooms nothing to do with the flights at all. i've contacted direct and zabeel are holding back a lot of their rooms and ghh are reluctant on the offering of a hb for a 3 bed. i do think once emirates release later this month i will see more movement and hopefully more offers. i was keen just to get one on hold at this point and that's a lot of money difference and a longer stay.
@ashesc no we went 2019 and stayed on the palm also. this will be our main break since christmas 2019 and as we live close to the hustle and bustle of london a good pool, time to chill great food and then plan accordingly for 3/4 days out max and it'll be over christmas so would anticipate all restaurants hopefully open.
@katie i loved zabeel that's where we stayed last time but this time it seemed to have gone up massively - loved the food in particular but could probably do an entertainer one night and go for a steak anyway - it still wouldn't be £3.7k and last time we had a club room which is not in that increase this time.
@sean yes definitely going to keep searching lucky me on having such a big family!
@lovedogs thank you that's why i have my reservations about ghh my children like water and i think although you can use the facilities of the meridien it seems a trek when one child inevitably forgets something on a daily basis and needs to go back to the room. my eldest although will be 17 when we travel is clueless on direction so she couldn't even be trusted to make her own way back.
what i would want to do this time would be breakfast desert safari (transfers included), ain wheel - same day as a mall, and actually atlantis we didn't do that last time. i think everyone cursed me when we did disney and universal as it was on such time restraints and schedule it felt as though we hadn't actually had a break same goes for city breaks when we do them. has anyone also done any fishing trips?
